import React from 'react';
import './Map.css'; // Import the CSS file

const Map = () => {
  return (
    <div className="container">
      <div className="row">
        {/* <h2>
          Responsive <small>Google Maps</small>
        </h2> */}

        <div className="custom-box">
          <h3 className="text-center">Find Us Here</h3>
          <div className="map-responsive">
          <iframe
              src="https://www.google.com/maps/embed?pb=!1m23!1m12!1m3!1d124443.28968134298!2d77.50362794255447!3d12.917180689293284!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!4m8!3e6!4m0!4m5!1s0x3bae599d9481068d%3A0xe8eb1105d3601838!2s1st%20Floor%2C%20Doctor%20Java%20Technologies%2C%20PTG%20Complex%2C%2035%2F24%2C%2011th%20Main%20Rd%2C%20opp.%20to%20Raghavendra%20Swamy%20Mutt%2C%20Vishya%20Bank%20Colony%2C%205th%20Block%2C%20Jayanagar%2C%20Bengaluru%2C%20Karnataka%20560041!3m2!1d12.9171936!2d77.58602979999999!5e0!3m2!1sen!2sin!4v1733209412315!5m2!1sen!2sin"
              width="600"
              height="450"
              frameBorder="0"
              style={{ border: 0 }}
              allowFullScreen=""
              loading="lazy"
              title="Google Map"
            ></iframe>
          </div>
        </div>
      </div>
      <hr />
    </div>
  );
};

export default Map;
